%[text] # OOPDELight in a Nutshell
%[text] ### Part 2
%[text] ## Boundary Segments vs. Boundary Elements/Edges
%[text] Some classes implementing standard domains habe more than one boundary segments. (A boundary segment is a collection of boundary edges, not necessarily connected). For instance, the Rectangle has four segments, the edges of the rectangle. (One can define objects with a very complex structure of the boundary segments, but here we will not use this feature.)
%[text] The method domain.identifyBoundarySegment  produces a figure so one can see the structure and numbering of boundary segments.
domain = Rectangle(-1,1,-2,2,0.1);
fprintf("The domain has %d boundary segments.\n",domain.nBoundarySegments); %[output:10292c24]
fprintf("The domain has %d boundary edges, i.e. outer edges of elements.\n",domain.nEdges); %[output:9102fce3]
figure(1)
domain.identifyBoundarySegment; %[output:19aafa4d]
%[text] Here, segment 1 and 3 contain on 20 edges, while segments 2 and 4 contain on 40 edges.
%[text] Here, the numbers run counterclockwise from button. To connect a boundary contition with a boundary segment, use this code.
domain.makeBoundaryMatrix(domain.neumannBC(0),...
                          domain.dirichletBC('sin(2*pi*s)'),...
                          domain.robinBC(1,0),...
                          domain.dirichletBC(1));
%[text] This modells the conditions
%[text]  $\\begin{array}{rcll}\nn \\cdot c\\nabla u&=&0&\\text{ on } \\Gamma\_1\\\\\nu&=&\\sin(s)&\\text{ on } \\Gamma\_2\\\\\nn\\cdot c\\nabla u + u &=&0&\\text{ on } \\Gamma\_3\\\\\nu&=&1&\\text{ on } \\Gamma\_4\\\\\n\\end{array}$
%[text] where $\\Gamma$ is the boundary of the rectangle $\\Omega$. and $s$ is the arclength parameter $0\<s\<1$ on the boundary segments. Note, s is scaled on the segments. You can use also parameters x and y here, but note that $-2\<y\<2$.  
%[text] However, for most applications, the parameters in the boundary conditions may be constants.
%[text] We solve
%[text]  $-\\Delta u = f \\text{ on }\\Omega$
%[text] on $\\Omega$ with  $f=\\begin{cases}\n5 \\text{ if }|y| \<1\\\\\n0 \\text{ otherwise}\n\\end{cases}$. 
FEM = Lagrange12D;
[K,~,F] = FEM.assema(domain,1,0,'5*double(abs(y)<1)');
[Q,G,H,R] = FEM.assemb(domain);

s = 1e2;
A = K+Q+s*(H'*H);
b = F+G+s*H'*R;

u = A\b;
figure(2)
domain.plot(u); %[output:9be02191]
view(2); %[output:9be02191]
%[text] The result behaves as expected. 
%[text] If you wish to define  one  boundary condition on all boundarye segments, it is sufficient to call makeBoundaryMatrix with just one argument. The call
%[text]  `domain.makeBoundaryMatrix(domain.neumannBC(0));`
%[text] defines homogeneous Dirichlet boundary conditions on all four boundary segments of the rectangle. 
%[text] 
%[text] ## Non-linear PDEs
%[text] We consider problems of the form
%[text]  $du\_t -\\nabla\\cdot  (c\\nabla u) + b \\cdot \\nabla u +a u + g(u) = f $
%[text] plus suited boundary conditions and initial values. Here, $d\>0$, $c\>0$.
%[text] Since OOPDELight do no offers time solvers, we have to implement them by ourself. The simplest suitable choice is Eulers's implicite method. We bring the space derivatives on the RHS and semi discretice the equation by Eulers's implicite method.
%[text]  $ d(u(t+dt) -u(t)) = dt \\left(\\nabla\\cdot  (c \\nabla u(t+dt)) -  b \\cdot \\nabla u(t+dt) - a u(t+dt) - g(u(t+dt)) + f \\right)$.
%[text] SInce we must solve now a nonlinear system in every stet, the idea is now to linearize $F$.  The simplest appoach is to use $F(u(t))$  insead of $F(u(t+dt))$. 
%[text]  $ d(u(t+dt) -u(t)) = dt \\left(\\nabla\\cdot  (c \\nabla u(t+dt)) -  b \\cdot \\nabla u(t+dt) - a u(t+dt) - g(u(t)) + f \\right)$.
%[text] After discretization by finite elements and setting $u(t+dt) = u\_{k+1}$ and $u(t)=u\_k$ we obtain
%[text]  $ (D+dt( K+ C+M) )u\_{k+1} = Du\_k-dt (G(u\_k) +F) $.
%[text] As an example we solve
%[text]  $\\begin{array}{rcll} \nu\_t -\\nabla\\cdot (\\nabla u) + \[1\\,\\, 1\]^\\top \\cdot \\nabla u + u + u^2 &=&0&\\text{on }\\Omega\\times\[0,T\]\\\\\nn\\cdot \\nabla c u &= & 0 & \\text{on } \\Gamma\\times\[0,T\]\\\\\nu(0) &=& \\sin(xy) & \\text{on } \\Omega\\times\[ t=0\]\n\\end{array}$
domain = Rectangle(-2,2,-2,2,0.1);
u = sin(domain.x.*domain.y)';
 
FEM = Lagrange12D;

dt = 0.01;

[K,D,~] = FEM.assema(domain,1,1,0);
[~,M,~] = FEM.assema(domain,0,1,0);
C = FEM.convection(domain,[1
                           1]);
for k = 1:100 %[output:group:4cbce091]
    u = (D+dt*(K))\(D*u-dt*M*u.^3);
    figure(3) %[output:98515b0c]
    domain.plot(u); %[output:98515b0c]
    view(2)
    drawnow
end %[output:group:4cbce091]

%[text] Second example: Brusselator.
%[text] The Bruesselator is a system of 2 equations of the form
%[text]  $\\begin{array}{rcll}\nu\_t &=& \\Delta u +A -(B+1)u + u^2v&\\text{on } \\Omega\\\\\nv\_t &=&D\\Delta v +Bu -u^2v\n\\end{array}$
%[text] plus boundary conditions (often used Neumann or periodic) and initial values for $u$ and $v$. 
%[text] The domain  $\\Omega \\subset \\mathbb R^d$, here we set $d=1$.  The coefficients $A,B,D\>0$ are constants. We use again a semi-implicite schema based on Euler's methods.
%[text] For the values of the coefficients we use the ones chosen in the example found on visualpde.com. 
%[text] Let $a=2+f$, $b=3$, $d=8$, $u(0) = 2$ and $v(0) = 2/3$. The boundary conditions are periodic. Let $\\Omega =(0,50)$. Let
%[text]  $f=\\begin{cases}\n-3 \\text{ if } 50\<x\<60\\\\\n\\,\\,\\,\\,0 \\text{ otherwise}\n\\end{cases}$.
%[text] This models an initial engergy given to the system.
%[text] 
a = 2;  b = 3;  d = 8.0; 

Omega = Interval([0,100],0.5);

FEM = Lagrange11D;
[K,M,F] = FEM.assema(Omega,1,1,1); 
%[text] We need an all zeros sparse matrix. For convinience, we assemble it as stiffness matrix with $c=0$.
[N,~,~] = FEM.assema(Omega,0,0,0);
%[text] Peroidic boundary conditions. involve it like Dirichlet by penalty parameter.
 
P = FEM.periodic(Omega);
dt = 0.1;
%[text] Predefine the constant part of the system. The parameter $s$  is the weight for the periodic boundary conditions. Set it to zero for switchung to homegeneous Neumann boundary conditions.
s = 1e2;

A = [M+dt*K+dt*(b+1)*M+s*P    N
     -dt*b*M      M+dt*d*K+s*P];

f1 = -3*(Omega.x>50& Omega.x<60);
 
Y  = [a * ones(Omega.nPoints,1)+f1'
          b/a * ones(Omega.nPoints,1)];
%[text] The Euler loop. Inside, we have to update the explicite,  non-linear part. Printing on the fly.
k = 0;
while true %[output:group:6dddf936]
    u = Y(1:Omega.nPoints);    
    v = Y(1+Omega.nPoints:end);

    figure(4) %[output:2e318e33]
    cla %[output:2e318e33]
    Omega.plot(u);
    view(2);
    axis([-1 101 0.8 3.2]);
    drawnow
    
    
    Fuv = M*(u.^2.*v);
    B = [M*u+dt*(a*F+Fuv)
              M*v-dt*Fuv];
     
    Y  = A\B;
    if k > 2000 
        break
    else        
        k = k + 1;
    end
end %[output:group:6dddf936]
